questionvariables.text:
aa:rand(3)+2; 
pm1:rand_with_prohib(-1,1,[0]); 
bb:pm1*(rand(15)+1); 
pm2:rand_with_prohib(-1,1,[0]); 
dd:pm2*(rand(15)+1); 
/* Define the function R(x) */ 
rx : (aa*x + bb)/(aa*x - dd); 
/*Repalce R(x) with y*/
x_eq: y = rx;  
/* Step 2: Swap x and y */ 
y_eq:x=subst(y,x,rhs(x_eq));
/* Solve for y */ 
solutions: solve(y_eq, y); 
y_solved: rhs(solutions[1]);
ta:y_solved;
